import React from "react";
import "./Synonyms.css";

export default function Synonyms(props) {
  if (props.synonyms) {
    return (
      <div className="Synonyms">
        <strong> Synonyms </strong>
        {props.synonyms.map(function (synonyms, index) {
          return <li key={index}>{synonyms} </li>;
        })}
      </div>
    );
  } else {
    return null;
  }
}
